    [],nt"revision_timestamp": "2016-01-23T06:19:07.217409",nt"name": "california-gillnet-fishery",nt"isopen":
    false,nt"url": null,nt"notes": "This  data set contains vessels, logbooks,
    fish size and landings data for three fleets of gillnet vessels that operate within
    200 mile of the U.S. west coast, mainly in waters off California. The three fleets
    consist of set gillnet vessels targeting halibut and angel sharks, small-mesh drift
    gillnet vessels targeting white sea bass and yellowtail and large-mesh drift gillnet
    vessels targeting swordfish and thresher sharks. In addition, observer data are
    available from the large-mesh drift gillnet fleet. The data are owned by CDFW and
    managed jointly by CDFW and SWFSC.",nt"license_title": null,nt"extras":
